def lengthOfLIS(nums: List[int]) -> int:
    if not nums:
        return 0
    dp = [1] * len(nums)
    for i in range(len(nums)):
        for j in range(i):
            if nums[i] > nums[j]:
                dp[i] = max(dp[i], dp[j] + 1)
    return max(dp)

def longestSubsequence(arr: list) -> int:
    number_dict = {}
    longest = 0
    for number in arr:
        left = number_dict.get(number - 1, 0)
        right = number_dict.get(number + 1, 0)
        length = 1 + max(left, right)
        number_dict[number] = length
        longest = max(longest, length)
    return longest

def max_non_adjacent_sum(nums: list) -> int:
    include, exclude = 0, 0
    for num in nums:
        new_exclude = max(include, exclude)
        include = exclude + num
        exclude = new_exclude
    return max(include, exclude)

def findSmallest(arr: list) -> int:
    res = 1  # Initialize result
    arr.sort()

    # Traverse the array and increment 'res' if arr[i] is
    # smaller than or equal to 'res'.
    for i in range(len(arr)):
        if arr[i] <= res:
            res = res + arr[i]
        else:
            break
    return res

def maxSubmatrixSum(matrix: List[List[int]]) -> int:
    rows, cols = len(matrix), len(matrix[0])
    max_sum = float('-inf')

    for left in range(cols):
        temp = [0] * rows
        for right in range(left, cols):
            for i in range(rows):
                temp[i] += matrix[i][right]

            current_sum = 0
            max_subarray_sum = float('-inf')
            for i in range(rows):
                current_sum = max(temp[i], current_sum + temp[i])
                max_subarray_sum = max(max_subarray_sum, current_sum)
            max_sum = max(max_sum, max_subarray_sum)

    return max_sum

