def maximizeCommonBit(arr: List[int]) -> int:
        zeroCount = [0] * 32
        oneCount = [0] * 32
        for num in arr:
            for bit in range(32):
                if (num & (1 << bit)) == 0:
                    zeroCount[bit] += 1
                else:
                    oneCount[bit] += 1

        ans = 0
        for i in range(32):
            if zeroCount[i] < oneCount[i]:
                ans |= (1 << i)

        return ans

def isFeasibleToDivideIntoEqualFactorialSumSublists(arr: List[int]) -> bool :
    total_sum = sum(arr)
    if total_sum % 2 != 0:
        return False
    target_sum = total_sum // 2

    fact = [1]
    for i in range(1, max(arr) + 1):
        fact.append(fact[-1] * i)

    dp = [False] * (target_sum + 1)
    dp[0] = True
    for x in arr:
        for j in range(target_sum, x - 1, -1):
            dp[j] |= dp[j - x]

    return dp[target_sum] and factSumExists(arr, target_sum, fact)

def factSumExists(arr, target_sum, fact):
    for i in range(1<<len(arr)):
        temp_sum = 0
        for j in range(len(arr)):
            if i & (1<<j):
                temp_sum += fact[arr[j]]
        if temp_sum == target_sum:
            return True
    return False

