def minScorePythagorean(arr: List[int], N: int) -> int:
    dp = [float('inf') for _ in range(N+1)]
    dp[0] = 0
    for i in range(N):
        sum_sq = 0
        for j in range(i, N):
            sum_sq += arr[j]
            sq = 0
            for k in range(i, j+1):
                sq += (arr[k] * arr[k])
            if (sum_sq*sum_sq) == (2*sq):
                dp[j+1] = min(dp[j+1], dp[i] + 1)
    return dp[N]

