def meanOfProductOfSubsets(candies: List[int], K: int) -> float:
    if K <= 0 or K > len(candies):
        return 0.0
    subsets_product = []
    for i in range(0, len(candies), K):
        subset = sorted(candies[i:i+K])
        product = 1
        for candy in subset:
            product *= candy
        subsets_product.append(product)
    return sum(subsets_product) / len(subsets_product)

def isPrime(n: int) -> bool:
    if (n <= 1):
        return False
    if (n <= 3):
        return True
    if (n % 2 == 0 or n % 3 == 0):
        return False
    i = 5
    while(i * i <= n):
        if (n % i == 0 or n % (i + 2) == 0):
            return False
        i += 6
    return True

def maxSumContiguousSubseq(arr: list) -> int:
    max_ending_here = 1
    min_ending_here = 1
    max_so_far = 1
    for i in range(len(arr)):
        if arr[i] > 0:
            max_ending_here = max_ending_here * arr[i]
            min_ending_here = min(min_ending_here * arr[i], 1)
        elif arr[i] == 0:
            max_ending_here = 1
            min_ending_here = 1
        else:
            temp = max_ending_here
            max_ending_here = max(min_ending_here * arr[i], 1)
            min_ending_here = temp * arr[i]
        if (max_so_far <  max_ending_here and isPrime(max_ending_here)):
            max_so_far = max_ending_here
    return max_so_far

