def lengthOfLIS(nums: List[int]) -> int:
    def binary_search(sub, target):
        low, high = 0, len(sub) - 1
        while low <= high:
            mid = (low + high) // 2
            if sub[mid] == target:
                return mid
            elif sub[mid] < target:
                low = mid + 1
            else:
                high = mid - 1
        return low

    sub = []
    for num in nums:
        if not sub or num > sub[-1]:
            sub.append(num)
        else:
            index = binary_search(sub, num)
            sub[index] = num
    return len(sub)

