	if (rem == 0):
		return -1

	remArr = {}
	ans = n
	currPrefSum = 0

	for i in range (n):
		currPrefSum = (currPrefSum + A[i]) % K
		remArr[currPrefSum] = i

		reqd = (currPrefSum - rem + K) % K
		if (reqd in remArr):
