    dp = [[False for i in range(total + 1)] for j in range(n + 1)]

    for i in range(n + 1):
        for j in range(total + 1):
            if i == 0 and j == 0:
                dp[i][j] = True
            elif i == 0:
                dp[i][j] = False
            elif j == 0:
                dp[i][j] = True
            else:
                if nums[i - 1] <= j:
                    dp[i][j] = dp[i - 1][j - nums[i - 1]] or dp[i - 1][j]
                else:
                    dp[i][j] = dp[i - 1][j]

    diff = total
    for j in range(total // 2, -1, -1):
        if dp[n][j]:
            diff = total - 2 * j
            break

    return diff

