def splitNaturalNumbers(N: int) -> List[List[int]]:
    if N == 1:
        return [[1], []]
    if N == 2:
        return [[2], [1]]
    sum = N*(N+1)//2
    half_sum = sum//2
    set1 = []
    set2 = []

    if sum%2==0:
        for i in range(N, 0, -1):
            if i<=half_sum:
                set1.append(i)
                half_sum -= i
            else:
                set2.append(i)
    else:
        half_sum = half_sum-1
        for i in range(N, 0, -1):
            if i<=half_sum:
                set1.append(i)
                half_sum -= i
            else:
                set2.append(i)

    return [set1,set2]

