        bit += 1
    answer = 0
    for i in range(bit):
        cntBitZero, cntBitOne = 0, 0
        for j in range(len(arr)):
            if ((arr[j] >> i) & 1):
                cntBitOne += 1
            else:
                cntBitZero += 1
        if (cntBitZero < cntBitOne and answer + (1 << i) <= max(arr)):
            answer += (1 << i)
    return answer

